import com.google.common.collect.ForwardingMultiset;
import com.google.common.collect.HashMultiset;
import com.google.common.collect.Multiset;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        // Creating a ForwardingMultiset instance
        ForwardingMultiset<String> multiset = new ForwardingMultiset<String>() {
            private final HashMultiset<String> delegate = HashMultiset.create();

            @Override
            protected HashMultiset<String> delegate() {
                return delegate;
            }
        };

        // Adding elements to the multiset
        /* write */ multiset.add("apple");
        multiset.add("banana");
        multiset.add("apple");
        multiset.add("orange");

        // Using a HashMap to count occurrences of each fruit
        Map<String, Integer> fruitCount = new HashMap<>();
        fruitCount.put("apple", 0);
        fruitCount.put("banana", 0);
        fruitCount.put("orange", 0);

        for (String fruit : multiset.elementSet()) {
            fruitCount.put(fruit, multiset.count(fruit));
        }

        // Performing some unrelated operations
        int totalFruits = 0;
        for (Map.Entry<String, Integer> entry : fruitCount.entrySet()) {
            totalFruits += entry.getValue();
        }

        // Simulate some complex logic
        if (totalFruits > 5) {
            System.out.println("We have a lot of fruits!");
        } else {
            System.out.println("We need more fruits.");
        }

        // Further operations on the multiset
        multiset.remove("banana");
        multiset.add("grape");

        // Read operation to get the count of "apple"
        /* read */ int appleCount = multiset.count("apple");
        System.out.println("Count of apples: " + appleCount);

        // Final statement to print all fruit counts
        System.out.println("Final fruit counts: " + fruitCount);
    }
}
